INSERT INTO `info_penyakit` (`jenis_info`, `info`) VALUES
('penyebab', '<p>\r\n\r\n</p><p class="MsoNormal" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nmargin-left:18.0pt;line-height:normal"><span style="font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN">-Konsumsi makanan yang mengandung vitamin C adalah\r\njeruk, tomat, mangga, pepaya dan lain-lain.</span></p><p>\r\n\r\n</p><p class="MsoNormal" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nmargin-left:18.0pt;line-height:normal"><span style="font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN">- Konsumsi Makanan yang kaya zat besi antara lain\r\nkuning telur, ikan segar dan kering, hati, daging, kacang-kacangan dan sayuran\r\nhijau.</span></p><p>\r\n\r\n</p><p class="MsoNormal" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-indent:18.0pt;line-height:normal"><span style="font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN">- Mengkonsumsi lebih banyak protein, mineral dan\r\nvitamin.</span></p><p>\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState="false" DefUnhideWhenUsed="false"\r\n  DefSemiHidden="false" DefQFormat="false" DefPriority="99"\r\n  LatentStyleCount="371">\r\n  <w:LsdException Locked="false" Priority="0" QFormat="true" Name="Normal"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 1"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="9" SemiHidden="true"\r\n   UnhideWhenUsed="true" QFormat="true" Name="heading 2"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="9" SemiHidden="true"\r\n   UnhideWhenUsed="true" QFormat="true" Name="heading 3"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="9" SemiHidden="true"\r\n   Unhide