 Locked="false" Priority="50" Name="List Table 5 Dark Accent 3"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="51"\r\n   Name="List Table 6 Colorful Accent 3"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="52"\r\n   Name="List Table 7 Colorful Accent 3"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="46"\r\n   Name="List Table 1 Light Accent 4"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 4"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 4"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 4"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 4"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="51"\r\n   Name="List Table 6 Colorful Accent 4"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="52"\r\n   Name="List Table 7 Colorful Accent 4"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="46"\r\n   Name="List Table 1 Light Accent 5"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="51"\r\n   Name="List Table 6 Colorful Accent 5"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="52"\r\n   Name="List Table 7 Colorful Accent 5"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="46"\r\n   Name="List Table 1 Light Accent 6"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="51"\r\n   Name="List Table 6 Colorful Accent 6"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="52"\r\n   Name="List Table 7 Colorful Accent 6"></w:LsdException>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Table Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]-->\r\n\r\n<br></p><p class="MsoNormal"><b style="mso-bidi-font-weight:normal"><span style="font-size:14.0pt;mso-bidi-font-size:12.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN">Kebutuhan Gizi</span></b></p><p class="readable-text"><b style="mso-bidi-font-weight:normal"><span style="font-size:14.0pt;mso-bidi-font-size:12.0pt">1.Trimester I<br>\r\n</span></b>Trimester pertama kehamilan merupakan masa penyesuaian seorang\r\nperempuan terhadap kehamilannya. Karena pada tiga bulan pertama ini pertumbuhan\r\njanin masih lambat, penambahan kebutuhan zat-zat gizinya pun masih relatif\r\nkecil. Hanya saja, seluruh zat gizi yang dikonsumsinya harus memenuhi kebutuhan\r\njanin. Kekurangan gizi tertentu atau terkonsumsinya zat adiktif berbahaya bisa\r\nmenyebabkan kegagalan pembentukan organ yang sempurna.</p><p class="readable-text">Pada trimester I ibu hamil memasuki masa anabolisme\r\nyaitu masa untuk menyimpan zat gizi sebanyak-banyaknya dari makanan yang\r\ndisantap setiap hari untuk cadangan persediaan pada trimester berikutnya. Dalam\r\nkeadaaan ini biasanya ibu hamil mengalami mual, muntah-muntah, dan tidak\r\nberselera makan, sehingga asupan makanan perlu diatur. Makanan sebaiknya\r\ndiberikan dalam bentuk kering, porsi kecil, dan frekuensi pemberian yang\r\nsering.</p><p class="MsoListParagraphCxSpFirst" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-18.0pt;line-height:normal;mso-outline-level:\r\n4;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\nmso-fareast-language:IN;mso-bidi-font-weight:bold"><span style="mso-list:Ignore"><span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN">Kalori</span></b></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Kalori dibutuhkan untuk perubahan\r\ndalam tubuh ibu hamil, meliputi pembentukan sel-sel baru, pengaliran makanan\r\ndari pembuluh darah ibu ke pembuluh darah janin melalui plasenta dan\r\npembentukan enzim serta hormon yang mengatur pertumbuhan janin. Selama\r\ntrimester pertama, wanita hamil perlu tambahan bobot badan sebanyak 0,5 kg\r\nsetiap minggu. Berdasarkan Angka Kecukupan Gizi rata-rata yang dianjurkan ibu\r\nhamil perlu tambahan 285 Kkal setiap hari atau sama dengan 2.485 Kkal per hari.\r\nKekurangan energi dalam asupan makanan yang dikonsumsi menyebabkan tidak\r\ntercapainya penambahan berat badan ideal dari ibu hamil yaitu sekitar 11 - 14\r\nkg.</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><b><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">&nbsp;</span></b></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-18.0pt;line-height:normal;mso-outline-level:\r\n4;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\nmso-fareast-language:IN;mso-bidi-font-weight:bold"><span style="mso-list:Ignore"><span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN">Protein</span></b></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Untuk membangun sel-sel baru janin,\r\ntermasuk sel darah, kulit, rambut, kuku, dan jaringan otot dibutuhkan protein.\r\nProtein juga diperlukan plasenta untuk membawa makanan ke janin dan juga\r\npengaturan hormon sang ibu dan janin. Tambahan protein yang dibutuhkan setiap\r\nhari adalah 60 g atau 12 g lebih banyak ketimbang wanita dewasa tak hamil.\r\nProtein dapat diperoleh dari bahan makanan seperti daging, keju, ikan, telur,\r\nkacang-kacangan, tahu, tempe dan oncom.</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">&nbsp;</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><b><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">&nbsp;</span></b></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-18.0pt;line-height:normal;mso-outline-level:\r\n4;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\nmso-fareast-language:IN;mso-bidi-font-weight:bold"><span style="mso-list:Ignore"><span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN">Serat</span></b></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Konsumsi serat banyak terdapat pada\r\nbuah dan sayuran, berguna untuk membantu kerja sistem ekskresi sehingga mudah\r\nbuang air besar.</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-18.0pt;line-height:normal;mso-outline-level:\r\n4;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\nmso-fareast-language:IN;mso-bidi-font-weight:bold"><span style="mso-list:Ignore"><span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN">Air</span></b></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Kekurangan air (dehidrasi) harus\r\nsegera ditanggulangi, karena dalam masa kehamilan muda ada kalanya terjadi\r\nmuntah-muntah sehingga banyak mengeluarkan cairan tubuh.</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-18.0pt;line-height:normal;mso-outline-level:\r\n4;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\nmso-fareast-language:IN;mso-bidi-font-weight:bold"><span style="mso-list:Ignore"><span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN">Vitamin dan Mineral</span></b></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Diperlukan vitamin dan mineral yang\r\nmerupakan zat gizi penting selama hamil. Vitamin A dalam jumlah optimal\r\ndiperlukan untuk pertumbuhan janin. Tidak kalah penting vitamin B1 dan B2 serta\r\nniasin yang diperlukan dalam proses metabolisme tubuh. Sedangkan vitamin B6 dan\r\nB12 berguna untuk mengatur penggunaan protein oleh tubuh. Vitamin C penting untuk\r\nmembantu penyerapan zat besi selama hamil untuk mencegah anemia.</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">&nbsp;</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpLast" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Untuk pembentukan tulang serta\r\npersendian janin diperlukan vitamin D yang membantu penyerapan kalsium. Kalsium\r\npenting untuk pertumbuhan tulang dan gigi janin. Zat kapur ini banyak terdapat\r\npada susu dan olahannya serta kacang-kacangan. Sementara itu vitamin E\r\ndiperlukan untuk pembentukan sel-sel darah merah serta melindungi lemak dari\r\nkerusakan. Asam folat dan seng penting untuk pertumbuhan susunan saraf pusat\r\nsehingga konsumsi makanan yang banyak mengandung asam folat dapat mengurangi\r\nrisiko kelainan susunan saraf pusat dan otak janin. Makanan yang kaya akan asam\r\nfolat misalnya jeruk, pisang, brokoli, wortel, dan tomat. Pasokan zat besi juga\r\ntidak kalah penting karena pada masa hamil volume darah ibu akan meningkat 30%.\r\nDi samping itu, plasenta harus mengalirkan cukup zat besi untuk perkembangan\r\njanin.</span></p><p>\r\n\r\n<br></p><p class="MsoNormal" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:4"><b><span style="font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN">2.Trimester II</span></b></p><p>\r\n\r\n<br></p><p class="MsoNormal" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN">Memasuki\r\ntrimester kedua, saat kehamilan berusia 4 - 6 bulan, janin mulai tumbuh pesat\r\ndibandingkan dengan sebelumnya. Kecepatan pertumbuhan itu mencapai 10 gram per\r\nhari. Tubuh ibu juga mengalami perubahan dan adaptasi, misalnya pembesaran\r\npayudara dan mulai berfungsinya rahim serta plasenta. Untuk itu, peningkatan\r\nkualitas gizi sangat penting karena pada tahap ini ibu mulai menyimpan lemak\r\ndan zat gizi lainnya untuk cadangan sebagai bahan pembentuk ASI (air susu ibu)\r\nsaat menyusui nanti. </span></p><p>\r\n\r\n<br></p><p class="MsoNormal" style="margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN">&nbsp;</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpFirst" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-18.0pt;line-height:normal;mso-outline-level:\r\n4;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\nmso-fareast-language:IN;mso-bidi-font-weight:bold"><span style="mso-list:Ignore"><span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN">Kalori</span></b></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Tubuh membutuhkan tambahan 285\r\nkalori setiap hari dibandingkan dengan sebelum hamil. Konsumsi makanan ini\r\nsetidaknya menghasilkan pertambahan bobot badan sekitar 8 - 15 kg sampai akhir\r\ntrimester ketiga. Sejak trimester kedua ini, diusahakan untuk menambah bobot \r\nkg setiap minggu. Di akhir bulan kehamilan, konsumsi karbohidrat (50 - 60% dari\r\ntotal kalori) diperlukan dalam takaran yang cukup untuk persiapan tenaga ibu\r\ndalam masa persalinan.</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-18.0pt;line-height:normal;mso-outline-level:\r\n4;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\nmso-fareast-language:IN;mso-bidi-font-weight:bold"><span style="mso-list:Ignore"><span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN">Protein</span></b></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Protein penting untuk pertumbuhan\r\njanin dan plasenta, juga untuk memenuhi kebutuhan suplai darah merah. Kebutuhan\r\nprotein didapat dari bahan makanan hewani seperti daging, ikan, telur, dan nabati\r\nseperti kacang-kacangan, tahu, dan tempe.</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-18.0pt;line-height:normal;mso-outline-level:\r\n4;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\nmso-fareast-language:IN;mso-bidi-font-weight:bold"><span style="mso-list:Ignore"><span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN">Vitamin dan Mineral</span></b></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Pada trimester kedua, tubuh\r\nmembutuhkan vitamin B6 dalam jumlah banyak dibandingkan sebelum hamil. Vitamin\r\nini dibutuhkan untuk membentuk protein dari asam amino, darah merah, saraf\r\notak, dan otot-otot tubuh. Bila protein tercukupi, maka kebutuhan vitamin B6\r\nakan tercukupi pula. Makanan yang banyak mengandung vitamin B6 ini antara lain\r\nikan. Jangan lupa mengonsumsi substansi omega-3 yang banyak terkandung dalam\r\ndaging ikan tuna dan salmon. Omega-3 juga berperan pada perkembangan otak dan\r\nretina janin.</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpMiddle" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Zinc dibutuhkan bagi sistem\r\nimunologi (kekebalan) tubuh. Konsumsi zinc juga dapat menghindari lahirnya\r\njanin prematur dan berperan dalam perkembangan otak janin, terutama pada\r\ntrimester terakhir. Diduga, kekurangan seng menyebabkan bibir sumbing. Makanan\r\nyang kaya seng antara lain daging sapi dan ikan.</span></p><p>\r\n\r\n<br></p><p class="MsoListParagraphCxSpLast" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;mso-outline-level:4"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN">Kalsium diperlukan pada trimester\r\npertama hingga trimester ketiga karena merupakan zat gizi penting selama\r\nkehamilan. Kebutuhan zat besi meningkat terutama pada awal trimester kedua\r\nkehamilan. Faktanya, hampir 70% ibu hamil di Indonesia menderita anemia. Sebab\r\nitu suplementasi pil besi diupayakan untuk diberikan selama kehamilan guna\r\nmemenuhi kebutuhan zat besi itu.</span></p><p>\r\n\r\n<br></p><p class="MsoNormal" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:4"><b><span style="font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN">3.Trimester III</span></b></p><p>\r\n\r\n<br></p><p class="MsoNormal">Sedangkan pada tahap terakhir atau trimester ketiga, ketika\r\nusia kehamilan mencapai 7 - 9 bulan, dibutuhkan vitamin dan mineral untuk\r\nmendukung pesatnya pertumbuhan janin dan pembentukan otak. Kebutuhan energi\r\njanin didapat dari cadangan energi yang disimpan ibu selama tahap sebelumnya.<b style="mso-bidi-font-weight:normal"><span style="font-size:14.0pt;mso-bidi-font-size:\r\n12.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN"></span></b></p><p>\r\n\r\n</p>');
INSERT INTO `kebutuhan_gizi` (`id_kebutuhan`, `trimester_1`, `trimester_2`, `trimester_3`, `faktor_pengaruh`) VALUES
(1, '<div class="card-panel card-2"><h4>Trimester I</h4><p class="readable-text text-home ttt">Trimester pertama kehamilan merupakan masa penyesuaian seorang perempuan terhadap kehamilannya. Karena pada tiga bulan pertama ini pertumbuhan janin masih lambat, penambahan kebutuhan zat-zat gizinya pun masih relatif kecil. Hanya saja, seluruh zat gizi yang dikonsumsinya harus memenuhi kebutuhan janin. Kekurangan gizi tertentu atau terkonsumsinya zat adiktif berbahaya bisa menyebabkan kegagalan pembentukan organ yang sempurna.</p><p class="readable-text text-home ttt">Pada trimester I ibu hamil memasuki masa anabolisme yaitu masa untuk menyimpan zat gizi sebanyak-banyaknya dari makanan yang disantap setiap hari untuk cadangan persediaan pada trimester berikutnya. Dalam keadaaan ini biasanya ibu hamil mengalami mual, muntah-muntah, dan tidak berselera makan, sehingga asupan makanan perlu diatur. Makanan sebaiknya diberikan dalam bentuk kering, porsi kecil, dan frekuensi pemberian yang sering.</p><p class="readable-text text-home">Menurut Karyadi (2010), zat gizi yang dibutuhkan ibu hamil trimester I, antara lain :</p><h4>Kalori</h4><p class="readable-text text-home ttt">Kalori dibutuhkan untuk perubahan dalam tubuh ibu hamil, meliputi pembentukan sel-sel baru, pengaliran makanan dari pembuluh darah ibu ke pembuluh darah janin melalui plasenta dan pembentukan enzim serta hormon yang mengatur pertumbuhan janin. Selama trimester pertama, wanita hamil perlu tambahan bobot badan sebanyak 0,5 kg setiap minggu. Berdasarkan Angka Kecukupan Gizi rata-rata yang dianjurkan ibu hamil perlu tambahan 285 Kkal setiap hari atau sama dengan 2.485 Kkal per hari. Kekurangan energi dalam asupan makanan yang dikonsumsi menyebabkan tidak tercapainya penambahan berat badan ideal dari ibu hamil yaitu sekitar 11 - 14 kg.</p></div><div class="card-panel card-2"><h4>Protein</h4><p>Untuk membangun sel-sel baru janin, termasuk sel darah, kulit, rambut, kuku, dan jaringan otot dibutuhkan protein. Protein juga diperlukan plasenta untuk membawa makanan ke janin dan juga pengaturan hormon sang ibu dan janin. Tambahan protein yang dibutuhkan setiap hari adalah 60 g atau 12 g lebih banyak ketimbang wanita dewasa tak hamil. Protein dapat diperoleh dari bahan makanan seperti daging, keju, ikan, telur, kacang-kacangan, tahu, tempe dan oncom.</p></div><div class="card-panel card-2"><h4>Serat</h4><p>Konsumsi serat banyak terdapat pada buah dan sayuran, berguna untuk membantu kerja sistem ekskresi sehingga mudah buang air besar.</p><div class="divider-line"><br></div><h4>Air</h4><p>Kekurangan air (dehidrasi) harus segera ditanggulangi, karena dalam masa kehamilan muda ada kalanya terjadi muntah-muntah sehingga banyak mengeluarkan cairan tubuh.</p></div><div class="card-panel card-2"><h4>Vitamin dan Mineral</h4><p>Diperlukan vitamin dan mineral yang merupakan zat gizi penting selama hamil. Vitamin A dalam jumlah optimal diperlukan untuk pertumbuhan janin. Tidak kalah penting vitamin B1 dan B2 serta niasin yang diperlukan dalam proses metabolisme tubuh. Sedangkan vitamin B6 dan B12 berguna untuk mengatur penggunaan protein oleh tubuh. Vitamin C penting untuk membantu penyerapan zat besi selama hamil untuk mencegah anemia.</p><p>Untuk pembentukan tulang serta persendian janin diperlukan vitamin D yang membantu penyerapan kalsium. Kalsium penting untuk pertumbuhan tulang dan gigi janin. Zat kapur ini banyak terdapat pada susu dan olahannya serta kacang-kacangan. Sementara itu vitamin E diperlukan untuk pembentukan sel-sel darah merah serta melindungi lemak dari kerusakan. Asam folat dan seng penting untuk pertumbuhan susunan saraf pusat sehingga konsumsi makanan yang banyak mengandung asam folat dapat mengurangi risiko kelainan susunan saraf pusat dan otak janin. Makanan yang kaya akan asam folat misalnya jeruk, pisang, brokoli, wortel, dan tomat. Pasokan zat besi juga tidak kalah penting karena pada masa hamil volume darah ibu akan meningkat 30%. Di samping itu, plasenta harus mengalirkan cukup zat besi untuk perkembangan janin.</p></div>', '<div class="card-panel card-2"><h4>Trimester II</h4><p>Memasuki trimester kedua, saat kehamilan berusia 4 - 6 bulan, janin mulai tumbuh pesat dibandingkan dengan sebelumnya. Kecepatan pertumbuhan itu mencapai 10 gram per hari. Tubuh ibu juga mengalami perubahan dan adaptasi, misalnya pembesaran payudara dan mulai berfungsinya rahim serta plasenta. Untuk itu, peningkatan kualitas gizi sangat penting karena pada tahap ini ibu mulai menyimpan lemak dan zat gizi lainnya untuk cadangan sebagai bahan pembentuk ASI (air susu ibu) saat menyusui nanti. Menurut Haryanto (2009), zat gizi yang dibutuhkan ibu hamil trimester II, antara lain :</p><div class="divider-line"><br></div><h4>Kalori</h4><p>Tubuh membutuhkan tambahan 285 kalori setiap hari dibandingkan dengan sebelum hamil. Konsumsi makanan ini setidaknya menghasilkan pertambahan bobot badan sekitar 8 - 15 kg sampai akhir trimester ketiga. Sejak trimester kedua ini, diusahakan untuk menambah bobot &frac12; kg setiap minggu. Di akhir bulan kehamilan, konsumsi karbohidrat (50 - 60% dari total kalori) diperlukan dalam takaran yang cukup untuk persiapan tenaga ibu dalam masa persalinan.</p></div><div class="card-panel card-2"><h4>Protein</h4><p>Protein penting untuk pertumbuhan janin dan plasenta, juga untuk memenuhi kebutuhan suplai darah merah. Kebutuhan protein didapat dari bahan makanan hewani seperti daging, ikan, telur, dan nabati seperti kacang-kacangan, tahu, dan tempe.</p></div><div class="card-panel card-2"><h4>Vitamin dan Mineral</h4><p>Pada trimester ketiga, tubuh membutuhkan vitamin B6 dalam jumlah banyak dibandingkan sebelum hamil. Vitamin ini dibutuhkan untuk membentuk protein dari asam amino, darah merah, saraf otak, dan otot-otot tubuh. Bila protein tercukupi, maka kebutuhan vitamin B6 akan tercukupi pula. Makanan yang banyak mengandung vitamin B6 ini antara lain ikan. Jangan lupa mengonsumsi substansi omega-3 yang banyak terkandung dalam daging ikan tuna dan salmon. Omega-3 juga berperan pada perkembangan otak dan retina janin.</p><p>Zinc dibutuhkan bagi sistem imunologi (kekebalan) tubuh. Konsumsi zinc juga dapat menghindari lahirnya janin prematur dan berperan dalam perkembangan otak janin, terutama pada trimester terakhir. Diduga, kekurangan seng menyebabkan bibir sumbing. Makanan yang kaya seng antara lain daging sapi dan ikan.</p><p>Kalsium diperlukan pada trimester pertama hingga trimester ketiga karena merupakan zat gizi penting selama kehamilan. Kebutuhan zat besi meningkat terutama pada awal trimester kedua kehamilan. Faktanya, hampir 70% ibu hamil di Indonesia menderita anemia. Sebab itu suplementasi pil besi diupayakan untuk diberikan selama kehamilan guna memenuhi kebutuhan zat besi itu.</p></div>', '<div class="card-panel card-2"><h4>Trimester III</h4><p>Sedangkan pada tahap terakhir atau trimester ketiga, ketika usia kehamilan mencapai 7 - 9 bulan, dibutuhkan vitamin dan mineral untuk mendukung pesatnya pertumbuhan janin dan pembentukan otak. Kebutuhan energi janin didapat dari cadangan energi yang disimpan ibu selama tahap sebelumnya.</p><p>Menurut Haryanto (2009), zat gizi yang dibutuhkan ibu hamil trimester III tidak berbeda dengan ibu hamil trimester II.</p></div>', '<div class="card-panel card-2"><h4>Faktor Penyakit Pada Ibu Hamil</h4><p>Penyakit kronis pada ibu hamil akan meningkatkan resiko terjadinya gangguan status gizi ibu dalam kehamilan, misalnya maag atau gastric ulcer yang menyebabkan ibu mengalami gangguan pola makan yang pada akhirnya akan mempengaruhi status gizi ibu selama kehamilan.</p></div>');
