INSERT INTO `tips` (`id_tips`, `isi_pakar`, `isi_pasien`, `kategori`) VALUES
(1, 'Berikan kombinasi 60 mg/ hari zat besi dan 400 mg asam folat peroral sekali sehari.', 'Ibu hamil teridentifikasi terkena anemia ringan, berikan Konseling gizi untuk ibu hamil agar terjaga pola makannya, ibu hamil harus menghindari pekerjaan yang berat dan istirahat yang cukup. \r\nDiberikan kombinasi 60 mg/ hari besi dan 400 mg asam folat peroral sekali sehari. Selanjutnya lakukan pemeriksaan rutin dan lakukan cek kadar hemoglobin ulang pada trimester III.', 'ringan'),
(2, 'Beri Pengobatan dengan kombinasi 120 mg zat besi dan 500 mg asam folat peroral sekali sehari.', 'Menurut gejala yang ibu hamil raskan dan kadar hb ibu hamil terkena anemia sedang,berikan Konseling gizi untuk ibu hamil agar terjaga pola makannya, ibu hamil harus menghindari pekerjaan yang berat dan istirahat yang cukup. Selanjutnya lakukan pemeriksaan rutin dan lakukan cek kadar hemoglobin ulang pada trimester III.', 'sedang'),
(3, 'Menurut hasil test hb ibu hamil terkena anemia berat,erikan konseling gizi untuk ibu hamil agar terjaga pola makannya, ibu hamil harus menghindari pekerjaan yang berat dan istirahat yang cukup.', 'Rujuk ke rumah sakit terdekat untuk mendapatkan pemeriksaan lebih lanjut dan untuk mendapatkan transfusi darah jika diperlukan.', 'berat'),
(4, 'Ibu hamil tidak terkena anemia.Berikan Konseling gizi untuk ibu hamil agar terjaga pola makannya, ibu hamil harus menghindari pekerjaan yang berat dan istirahat yang cukup.sehingga, ibu hamil tidak berpeluang untuk terkena anemia. Diberikan Fe program dan lakukan pemeriksaan rutin sesuai jadwal.', '', ''),
